    setEditdate(!editdate);
  }
  const changeConfirm = () =>{
    setEditdate(!editdate);
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Potluck Planner</h1>
        <hr></hr>
      </header>

        {editdate ? <DisplayDate changeEdit = {changeEditDate}/> : <EditDate changeEdit = {changeEditDate}/>}


    </div>
  );
}

export default App;
